роги\"?','Выделенный конструктивно или с помощью линий горизонтальной дорожной разметки элемент дороги, предназначенный для движения велосипедов, обозначенный дорожным знаком «Велосипедная дорожка»./Полоса земли, на которой размещается дорога и все ее сооружения.','Элемент дороги, предназначенный для движения транспортных средств и в случаях, предусмотренных Правилами дорожного движения, - для движения пешеходов.',''),(59,'1','Железнодорожным переездом считается:','Пересечение дороги с трамвайными путями на одном уровне./Пересечение дороги с железнодорожными путями на разных уровнях./Oтветы, указанные в пунктах 1 и 2.','Пересечение дороги с железнодорожными путями на одном уровне.',''),(60,'1','Ограниченная обзорность — это:','Видимость дороги в направлении движения менее 300 м в условиях дождя./Обзорность дороги, ограниченная величиной и регулировкой зеркал заднего вида.','ПВидимость дороги в направлении движения, ограниченная геометрическими параметрами дороги, придорожными инженерными сооружениями, насаждениями и другими объектами, а также транспортными средствами.','');
